window.bookSummaryJSON = "<p>How well would you cope after being summoned to rule a kingdom in an RPG?</p> <p>Sean de Courcy is a gamer with a maxed out warrior build on a popular MMORPG. When the desperate rulers of a declining kingdom need a warrior to help lead them to triumph over their enemies, their summoning spell picks Sean. Their world obeys the rules of an RPG, so although Sean has no real world fighting experience, he is exactly the person they need to manage the kingdom, increase the levels of the PCs, and lead their armies to victory.</p> <p>An Isekai LitRPG with base building.</p>"; 
